import { Route } from "react-router-dom";

import { AuthContextProvider } from "./context/AuthContext";
import MainNavigation from "./components/layout/MainNavigation";
import HomePage from "./pages/HomePage";
import SignInPage from "./pages/SignInPage";
import AccountPage from "./pages/SignInPage";

function App() {
  return (
    <div>
      <AuthContextProvider>
        <MainNavigation />
        <Route exact path="/">
          <HomePage />
        </Route>
        <Route path="/signin">
          <SignInPage />
        </Route>
        <Route path="/account">
          <AccountPage />
        </Route>
      </AuthContextProvider>
    </div>
  );
}

export default App;
